import React,{useState} from "react";

const[testTitle, modifyTitle] = useState(['testtext1','testtext2','testtext3']);

function ChangeTitle(){
    var newArray = [...testTitle];
    newArray[0] = 'mpdified text';
    modifyTitle(newArray);
}

function Test(){
    return(
        <div className="Test">
            <button onClick={modifyTitle}>button</button>
            <h3>
                {testTitle[0]}
            </h3>
        </div>
    );
}

export default Test;
